describe('parse API', function () {
  it('It should take the sierra API response and change some of the fields to match the export table output', function () {
    var r = parsLib.modifyBib(Object.assign(aBib))
    r.leader.should.equal('00000cas  2200361 a 4500')
    var has952 = false
    var has907 = false

    r.varFields.forEach((f) => {
      if (f.marcTag && f.marcTag === '952') has952 = true
      if (f.marcTag && f.marcTag === '907' && f.subfields[0].content === '.b117910272') has907 = true
    })
    has952.should.equal(true)
    has907.should.equal(true)
  })
  it('It should convert the sierra json format into the marc in json format', function () {
    var r = parsLib.modifyBib(Object.assign(aBib))
    r = parsLib.convertToMiJFormat(r)
    should.exist(r.leader)
    should.exist(r.fields)

    // lets make sure it has a well structured title
    r.fields.forEach((f) => {
      if (f['245']) {
        should.exist(f['245'].ind1)
        should.exist(f['245'].ind2)
        should.exist(f['245'].subfields)
        f['245'].subfields[0]['a'].should.equal('JPRS.')
      }
    })
  })
  it('It should convert the sierra json item response into 852 and 876 MiJ format', function () {
    var r = parsLib.convertItemsToMiJ(items)
    // console.log(JSON.stringify(r, null, 2))
    // see if they have all the right fields created
    r.forEach((f) => {
      if (f['852']) {
        var hasA = 'No hasA'
        var hasB = 'No hasB'
        var hasH = 'No hasH'
        var hasY = 'No hasY'
        f['852'].subfields.forEach((sf) => {
          if (Object.keys(sf)[0] === 'a') hasA = 'Has hasA'
          if (Object.keys(sf)[0] === 'b') hasB = 'Has hasB'
          if (Object.keys(sf)[0] === 'h') hasH = 'Has hasH'
          if (Object.keys(sf)[0] === 'y') hasY = 'Has hasY'
        })
        hasA.should.equal('Has hasA')
        hasB.should.equal('Has hasB')
        hasH.should.equal('Has hasH')
        hasY.should.equal('Has hasY')
      } else {
        var hasA2 = 'No hasA2'
        var hasK2 = 'No hasK2'
        var hasJ2 = 'No hasJ2'
        var hasO2 = 'No hasO2'
        var hasP2 = 'No hasP2'
        var hasS2 = 'No hasS2'
        var hasT2 = 'No hasT2'
        var hasY2 = 'No hasY2'
        var has3 = 'No has3'
        f['876'].subfields.forEach((sf) => {
          if (Object.keys(sf)[0] === 'a') hasA2 = 'Has hasA2'
          if (Object.keys(sf)[0] === 'k') hasK2 = 'Has hasK2'
          if (Object.keys(sf)[0] === 'j') hasJ2 = 'Has hasJ2'
          if (Object.keys(sf)[0] === 'o') hasO2 = 'Has hasO2'
          if (Object.keys(sf)[0] === 'p') hasP2 = 'Has hasP2'
          if (Object.keys(sf)[0] === 's') hasS2 = 'Has hasS2'
          if (Object.keys(sf)[0] === 't') hasT2 = 'Has hasT2'
          if (Object.keys(sf)[0] === 'y') hasY2 = 'Has hasY2'
          if (Object.keys(sf)[0] === 'y') has3 = 'Has has3'
        })

        hasA2.should.equal('Has hasA2')
        hasK2.should.equal('Has hasK2')
        hasJ2.should.equal('Has hasJ2')
        hasO2.should.equal('Has hasO2')
        hasP2.should.equal('Has hasP2')
        hasS2.should.equal('Has hasS2')
        hasT2.should.equal('Has hasT2')
        hasY2.should.equal('Has hasY2')
        has3.should.equal('Has has3')
      }
    })

    return r
  })

  // need this for the final convertToMiJFormat test below
  it('It should load the barcode file into memeory', function (done) {
    parsLibMrc.loadBarcodes('test/barcode.test.txt', () => {
      done()
    })
  })

  it('Should build the XML output from the API input', function () {
    var bib = parsLib.modifyBib(Object.assign(aBib))
    bib = parsLib.convertToMiJFormat(bib)
    var itemsMiJ = parsLib.convertItemsToMiJ(items)
    bib.fields = bib.fields.concat(itemsMiJ)
    var record = {mij: bib}
    record.bNumber = parsLibMrc.extractBnumber(record.mij) // 907|a
    record.oclcNumber = parsLibMrc.extractOclc(record.mij)
    record.bibCallNumber = parsLibMrc.extractBibCallNumber(record.mij)
    record.itemData = parsLibMrc.extractItemFields(record.mij) // 852 + 876
    record.holdingData = parsLibMrc.extractHoldingFields(record.mij) // 866 data
    record.controlFields = parsLibMrc.extractControlFields(record.mij) // control fields in mij format
    record.dataFields = parsLibMrc.extractDataFields(record) // data fields in mij format

    // build the new data structures
    record.items = parsLibMrc.buildItems(record)
    record.recordObj = parsLibMrc.buildRecord(record)
    record.items['*SEE (Canada. Parliament. Sessional papers of the Dominion of Canada)'].length.should.equal(37)
    console.log(record.recordObj)
    // record.recordObj.bibRecord.bib.holdings.length.should.equal(1)
  // const xml2js = require('xml2js')
  // const builder = new xml2js.Builder({renderOpts: {pretty: false}, headless: true})
  // console.log(builder.buildObject(record.recordObj))
  })

  it('Mod11 checkdigit', function () {
    parsLib.mod11(10018602).should.equal('100186026')
    parsLib.mod11(10004128).should.equal('100041280')
    parsLib.mod11(10024515).should.equal('100245158')
    parsLib.mod11(10018628).should.equal('100186282')
    parsLib.mod11('10319812').should.equal('10319812x')
    parsLib.mod11('i10940708').should.equal('i109407088')
    parsLib.mod11('.i11131021').should.equal('.i111310210')
    parsLib.mod11('.b11131021').should.equal('.b111310210')
    parsLib.mod11('.c11131021').should.equal('.c111310210')
  })
})
